async function localSyncPay() {
    console.log("==== Inside localSyncPay locally ====");
    let responseContent = "";

    // All payments
    // let body = "auth[app_id]=mac-pro&auth[app_key]=1234abcd&pay[action]=fetch&pay[id_CustomerInternal]=1&type=payment";
    // Approved Payments
    let body = "auth[app_id]=mac-pro&auth[app_key]=1234abcd&pay[action]=fetch&pay[id_CustomerInternal]=1&type=payment&pay[approved]=1&pay[status]=1";
    // Updates Web Payment in the database.
    // body = "auth[app_id]=mac-pro&auth[app_key]=1234abcd&pay[action]=update&pay[id]=12008&pay[sub_payment_no]=3461&pay[status]=1&type=payment";

    let result = Util.parseStr(body);
    let json = JSON.parse(JSON.stringify(result)); // Converting to JSON
    let pay = SyncPayHandler.getPay(json);

    if (pay && pay.action) {
        if (pay.action === ACTIONS.FETCH) {
            console.log("===== Inside fetch record process =====");
            try {
                responseContent = await SyncPayHandler.getRecordsFromCustomerPayments(pay);
            } catch (error) {
                console.log("=== Failed to fetch customer internal id from customer_payments table for Id: " + pay.id);
                responseContent = "Failed to fetch customer_payments";
            }
            console.log("===== Completed fetch record process =====");
        }

        if (pay.action === ACTIONS.UPDATE) {
            console.log("===== Inside update record process =====");
            try {
                responseContent = await SyncPayHandler.updateQueryForCustomerPayments(pay);
            } catch (error) {
                console.log("=== Failed to update customer_payments table for Id: " + pay.id);
                responseContent = "Failed to update customer_payments.";
            }
            console.log("===== Completed update record process =====");
        }
    }

    console.log(responseContent);
}
async function parseQueryStringToJson(queryString) {
    const params = new URLSearchParams(queryString);
    const jsonResult = {};

    for (const [key, value] of params.entries()) {
        // Convert the query string key into nested objects
        const keys = key.split(/\[|\]/).filter(Boolean);
        let currentLevel = jsonResult;

        keys.forEach((k, i) => {
            if (i === keys.length - 1) {
                currentLevel[k] = decodeURIComponent(value); // Set the final value
            } else {
                if (!currentLevel[k]) currentLevel[k] = {}; // Create an empty object if it doesn't exist
                currentLevel = currentLevel[k]; // Move to the next level
            }
        });
    }

    return jsonResult;
}

